use ndarray::{array, Array1, Array2};
use std::fs::File;
use std::io::Write; The first line imports the already familiar methods to manipulate a 2-body system and, with system::System the methods that any System has available. Then, inside the main function, we shall wipe out the default "Hello, world" stuff and start by adding some information that will make up our TwoBodySystem to be: let mu: f64 = two_body::calculate_mu(3.301e23, 1.989e30); let rr: Array1<f64> = array![-69.818e9, 0., 0.]; let vv: Array1<f64> = array![0., -38.86e3, 0.]; let end_time: f64 = 7603200.; These are the same things that were allready used in our first 2-body simulation of Mercury. Next we'll do something different though: create a TwoBodySystem: let system: two_body::TwoBodySystem = two_body::create_two_body_system(0., end_time, 100, mu, rr, vv); The inputs of the create_two_body_system are: starting time of the simulation, ending time of the simulation, number of simulated steps, the gravitational parameter, the initial position of the orbiting body with respect to the central body and the initial velocity of the orbiting body with respect to the central body. You can always also check the function out in the technical docs. Any simulation of a System will output an array of arrays (Array2<f64>) where the rows are simulation results for all the simulation steps and a the columns represent time, x,y and coordinates and vx, vy and vz going from column number 0 upwards. For a TwoBodySystem the cartesian coordinated are with respect to a system where the xy-plane is defined as the plane against which inclination is measured and positive x-axis points into the direction from which longitude of the ascending node is measured. To get simulation result orbit, we do: let orbit: Array2<f64> = system.simulate(); And then write the simulation results in a file to be used for visualisations: let mut coordinate_file = File::create("mercury.csv").unwrap(); write!(coordinate_file, "t,x,y,z,v_x,v_y,v_z\n").unwrap(); for i in 0..orbit.dim().1 { write!( coordinate_file, "{},{},{},{},{},{},{}\n", orbit[[0, i]], orbit[[1, i]], orbit[[2, i]], orbit[[3, i]], orbit[[4, i]], orbit[[5, i]], orbit[[6, i]] ) .unwrap(); } The complete `main.rs` use celmec::{system::System, two_body};
